import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import Dashboard from './components/Dashboard';
import DoctorList from './components/sections/DoctorList';
import Doctordashboard from './components/Doctordashboard';
import PatientDashboard from './components/PatientDashboard';
import DoctorProfile from './components/DoctorProfile'; // Import correctly

function App() {
  const [doctors, setDoctors] = useState([]);

  const addDoctor = (doctor) => {
    setDoctors((prevDoctors) => [...prevDoctors, doctor]);
  };

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/Doctordashboard" element={<Doctordashboard />} />
        <Route path="/PatientDashboard" element={<PatientDashboard />} />
        <Route path="/doctorlist" element={<DoctorList doctors={doctors} />} />
        <Route path="/doctorprofile" element={<DoctorProfile />} /> {/* Add if needed */}
        <Route path="/createdoctor" element={<CreateDoctor addDoctor={addDoctor} />} />
      </Routes>
    </Router>
  );
}

export default App;
